import React from "react";

const VideoPage = () => {
  return (
    <div className="relative w-full h-screen bg-black flex items-center justify-center overflow-hidden">
      {/* Left glowing circle */}
      <div className="flex items-center space-x-4">
        <div className="relative w-24 h-24 bg-black border-4 border-purple-700 rounded-full flex items-center justify-center shadow-[0_0_15px_5px_rgba(128,0,255,0.7)]">
          <div className="w-12 h-12 bg-white rounded-full flex items-center justify-center">
            <div className="w-6 h-6 bg-purple-700 rounded-full"></div>
          </div>
        </div>

        {/* Text and Font Selector */}
        <div className="flex items-center space-x-6">
          {/* Text Block */}
          <div className="flex flex-col items-center text-purple-400">
            <div className="w-12 h-12 bg-gray-800 flex items-center justify-center rounded-md shadow-md">
              <span className="text-lg font-bold">Aa</span>
            </div>
            <span className="mt-2 text-sm">Texts</span>
          </div>

          {/* Font Selector */}
          <div className="flex items-center bg-gray-800 px-4 py-2 rounded-lg shadow-md">
            <span className="text-purple-400 mr-4">Font</span>
            <div className="flex space-x-2">
              <button className="px-3 py-1 text-sm bg-purple-700 text-white rounded-md">
                px
              </button>
              <button className="px-3 py-1 text-sm bg-gray-600 text-white rounded-md">
                rem
              </button>
            </div>
          </div>
        </div>
      </div>

      {/* Right Text */}
      <div className="absolute right-10 top-1/2 transform -translate-y-1/2 text-purple-400 text-sm">
        100 description created
      </div>

      {/* Gradient Overlay */}
      <div className="absolute bottom-0 left-0 w-full h-32 bg-gradient-to-t from-purple-900 to-transparent"></div>
    </div>
  );
};

export default VideoPage;
